import { Link } from "react-router-dom";
const Products = () => {
  return (
    <section>
      <h1>The product Page</h1>
      <ul>
        <li>
          <Link to="./products/p1">A Book</Link>
        </li>
        <li>
          <Link to="./products/p2">A Hero</Link>
        </li>
        <li>
          <Link to="./products/p3">A DevilFruit</Link>
        </li>
      </ul>
    </section>
  );
};

export default Products;
